import React from 'react';
import ReactDOM from 'react-dom';

import Cards from "./Cards";
import './index.css';
import Sdata from './Sdata';

function Nweberies(val){
  <Cards 
  crdimg = {Sdata[0].simgsrc}
  title= {Sdata[0].stitle}
  category= {Sdata[0].scategory} 
  link= {Sdata[0].slink} 
  />
}

function App(){
    return (
        <React.Fragment>        
        <h1 className='heading_style'>The Top 5 Netflix Weberies</h1>
        {Sdata.map(Nweberies)}
      </React.Fragment>
    )
}

export default App;
